# Latitude referred to the WGS 84 ellipsoid in degrees
from FreeTAKServer.model.FTSModelVariables.PointVariables import PointVariables as vars


class Point(FTSProtocolObject):

    def __init__(self, le=vars().LE, ce=vars().CE, hae=vars().HAE, lon=vars().LON, lat=vars().LAT):
        self.le = le
        self.ce = ce
        self.hae = hae
        self.lon = lon
        self.lat = lat

    # ce getter
    def getce(self):
        return self.ce

    # ce setter
    def setce(self, ce):
        self.ce = ce

    # le getter
    def getle(self):
        return self.le

    # le setter
    def setle(self, le):
        self.le = le

    # lat getter
    def getlat(self):
        return self.lat

    # lat setter
    def setlat(self, lat):
        self.lat = lat

        # lon getter
    def getlon(self):
        return self.lon

    # lon setter
    def setlon(self, lon):
        self.lon = lon

    def gethae(self):
        return self.hae

    def sethae(self, hae):
        self.hae = hae
